divisionSelect.onchange=function () {
    div=divisionSelect.selectedOptions[0].text;
    districtSelect.innerHTML='<option value="">Select district</option>';
    thanaSelect.style.display="none";
    areaSelect.style.display="none";
    if(BANGLADESH[div]==null){
        districtSelect.style.display="none";
        return;
    }
    districtSelect.style.display="inline";
    var i=0;
    for(dist in BANGLADESH[div]){
        districtSelect.innerHTML+='<option value="'+i+'">'+dist+'</option>';
        i++;
    }
    thanaSelect.innerHTML='<option value="">Select Thana</option>';
    areaSelect.innerHTML='<option value="">Select Area</option>';
};

districtSelect.onchange=function () {
    dist=districtSelect.selectedOptions[0].text;
    thanaSelect.innerHTML='<option value="">Select Thana</option>';
    areaSelect.style.display="none";
    if(BANGLADESH[div][dist]==null){
        thanaSelect.style.display="none";
        return;
    }
    thanaSelect.style.display="inline";
    var i=0;
    for(thana in BANGLADESH[div][dist]){
        thanaSelect.innerHTML+='<option value="'+i+'">'+thana+'</option>';
        i++;
    }
    areaSelect.innerHTML='<option value="">Select Area</option>';
};

thanaSelect.onchange=function () {
    thana=thanaSelect.selectedOptions[0].text;
    areaSelect.innerHTML='<option value="">Select Area</option>';
    if(BANGLADESH[div][dist][thana]==null){
        areaSelect.style.display="none";
        return;
    }
    areaSelect.style.display="inline";
    var area=BANGLADESH[div][dist][thana];
    for(i=0;i<area.length;i++){
        areaSelect.innerHTML+='<option value="'+i+'">'+area[i]+'</option>';
    }
};

facultySelect.onchange=function () {
    var faculty=facultySelect.selectedOptions[0].text;
    departmentSelect.innerHTML='<option value="">Select Department</option>';
    if(DU[faculty]==null){
        departmentSelect.style.display="none";
        return;
    }
    departmentSelect.style.display="inline";
    for(var i=0;i<DU[faculty].length;i++){
        departmentSelect.innerHTML+='<option value="'+i+'">'+DU[faculty][i]+'</option>';
    }
};

